import React from 'react';
import { Grid, Image,Segment } from 'semantic-ui-react'

const _SearchMovieListDisplay = (props) => {
    return (
        <React.Fragment>
            <Segment placeholder>
                <div onClick={props.movieDetails}>
                    <center className="customImageDisplay">
                        <Image inline src={props.movieImage}
                            className="sizeOfContainerMovieImage"
                        />
                    </center>
                </div>
            </Segment>
        </React.Fragment>
    )
}

export default _SearchMovieListDisplay;
